import logo from './logo-1.png';
import './App.css';
import geopossition from './geopossition.png';
import time from './time.png';

function App() {
  return (
    <div className="NavBar">
      <img src={logo} alt="logo" className="Logo-1"/>
      <ul className="Top-bar"> 

      <li className="Address"><img src={geopossition} className="Geoposs"/>г. Москва, ул. Вешних вод, 4с170</li>
      <li className="Works"><img src={time} className="Time"/>Пн-Вс 10.00 - 21.00</li>

      </ul>
    </div>
  );
}

export default App;
